import BuscaProduto from "../BuscaProduto/Index";
import ImagemProduto from "../ImagemProduto/Index";
import InputDefault from "../Input/Index";
import Menu from "../Menu/Index";
import "./PgProduto.css"


const PgProduto = () => {
    return (<div className="container-produto">

        <Menu />
        <div className="container-inputpadrao">
        <BuscaProduto/>
        </div>
        <ImagemProduto src="/imagens/ga021-1"/>

    
    </div>);
}

export default PgProduto;
